import React, { Component } from "react";
import { Link } from "react-router-dom"; 

class App extends Component {
  render() {
    return (
        <div>
          <div align="center" className="sectionBack">
            <span className="textBack"><Link to="./Services.js">ADVANCES</Link></span>
          </div>
        </div>
    );
  }
}

export default App;
